// src/pages/DefaultDashboard.js
import React from 'react';
import LightweightChart from '../LightweightChart';
import SetupFeed from '../components/SetupFeed';
import SetupReview from '../components/SetupReview'
import { exportSetupLogCSV, getSetupLog } from '../alerts/setupLogger';

const DefaultDashboard = () => {
  const allSetups = getSetupLog().filter((s) =>
    ['WarriorEdge', 'MomentumEdge', 'TrendEdge'].includes(s.dashboard)
  );

  const handleExport = () => {
    const csv = exportSetupLogCSV();
    const blob = new Blob([csv], { type: 'text/csv;charset=utf-8;' });
    const url = URL.createObjectURL(blob);
    const link = document.createElement('a');
    link.href = url;
    link.setAttribute('download', 'icc_summary_setups.csv');
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
  };

  return (
    <div style={{ padding: '2rem' }}>
      <h2>ðŸ§  ICC Summary Dashboard</h2>

      {/* Chart previews for all setups */}
      {allSetups.map((setup, index) => (
        <div key={index} style={{ marginBottom: '2rem', overflowX: 'auto' }}>
          <LightweightChart
            symbol={setup.symbol}
            timeframe={setup.timeframe}
            overlays={['VWAP', 'SessionZones']}
            tags={setup.iccTags}
            priceAtTrigger={setup.priceAtTrigger}
            outcome={setup.outcome}
          />
        </div>
      ))}

      {/* ICC Setup Feed */}
      <div style={{ marginBottom: '1.5rem' }}>
        <SetupFeed setups={allSetups} />
      </div>

      {/* Setup Review */}
      <div style={{ marginBottom: '1.5rem' }}>
        <SetupReview setups={allSetups} />
      </div>

      {/* CSV Export Button */}
      <button onClick={handleExport} style={{ marginTop: '1rem' }}>
        ðŸ“¤ Export All ICC Setups to CSV
      </button>
    </div>
  );
};

export default DefaultDashboard;
